(27, 'Mrs.', 'Wendy', 'Waterfield', '', 'Wendy', '', 'She/Her', '1946-11-30', 'DM - Diabetes mellitus Anxiety (finding) Depression On severe mental illness register Bipolar disorder (disorder) CKD - chronic kidney disease Has a tremor', '1922414158', '', 'Christianity', 'Female', 'Cannock', '32', 'Bluebell Lane, Great Wyrley, West Midlands', 'Wolverhampton', 'West Midlands', 'WS6 6HG', 'United Kingdom', 'Key safe: 2304B', 'Wendy Waterfield (WW) lives with her husband in a bungalow. \r\nDNAR: NOT IN PLACE.\r\nWW will have only female carers.\r\nWW is diagnosed with severe mental illness, diabetes (type2), Bipolar and, depression and anxiety.\r\nWW communicates verbally and will respond when prompted.\r\nWW is independently mobile on a good day and will struggle on certain days, Risk of fall observed.\r\nWW had several falls within a short time in January due to her legs giving way which took her to the hospital. Carer to monitor and support when walking around.\r\nWW gets very anxious when her husband is not within sight, encouragement and reassurance is required.\r\nWW has shaky hands which makes it difficult to hold her cup of drink, she would most times lean forward from her resting chair to drink with a straw from her cup, a carer to support with her drinks.\r\nWW is double continent and will request to use the toilet when she requires to, carer to support to use the toilet. when this is not practicable, her commode can be used.\r\nWW is yet to be seen by the OT concerning her mobility.\r\nWW\'s husband supports with her medications and meals, and carers are to support her with making a drink, offer snacks or preparing meals when her husband is not able to.\r\ncarer to support with strip wash daily and shower when required. WW likes to have a wash and change into a Nightie before going to bed as well.\r\nWW has got pressure sore in her upper thigh, pressure areas are to be monitored and cream applied as required.', 'Wolverhampton', 'Left Service', 'rgba(142, 68, 173,1.0)', '2024-02-27T12:00', '2025-02-27T12:00', '7ae2e38b8a061c800b79e936605201b371b027284a4a2c5650cd3da9581421a9', 'Domiciliary care', 'Wendy used to like cycling. presently likes to sit by the fire place in home due to declined mobility.', 'Wendy used to like cycling. presently likes to sit by the fire place in home due to declined mobility.', 'Null', '\r\nDM - Diabetes mellitus\r\nAnxiety (finding)\r\nDepression\r\nOn severe mental illness register\r\nBipolar disorder (disorder)\r\nCKD - chronic kidney disease\r\nHas a tremor', 'Null', 'Null', 'Null', 'Null', '', '', '52.6518755', '-2.0140535', '', '6060215', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-17 09:33:37');
