(28, 'Ms.', 'Muriel', 'Lotwick', '', 'Muriel', '', 'She/Her', '1936-02-07', 'Diabetes, Psoriasis ', '1543682314', '', 'None', 'Female', 'Burntwood', '42', 'Burntwood Rd, Burntwood, Staffordshire, ', 'Wolverhampton', 'West Midlands', 'WS7 0JG', 'United Kingdom', 'key safe: 3390. note that the house is not between number 41 and 43.\r\nlocation: key safe is at the left side corner of the entrance door of the house.\r\nWalk into Forge Close to see the entrance door at left side of the bungalow\r\nThe house (bungalow) is located at the junction of Forge Close (opposite house number 64 burntwood road) or opposite an old wooded bus stop.', 'Muriel is an elderly lady who lives alone in her bungalow. Family visits occasionally and neighbour friend visits regularly.\r\nML has lived in property for over 52years.\r\nDNAR: NO.\r\nDIAGNOSES: DIABETES, PSORIASIS.\r\nused to be an organ (piano) teacher and likes to remain independent.\r\nML takes her medication independently and does her house chores by herself. carers to support with application of creams on body due to her Psoriasis. (Psoriasis is non-contageous).\r\nML has pressure sore in bottom and has cream for sore.\r\nML is double continent and mobilises independently with a stick.\r\nML requires support with personal care (daily wash and shower when she requires it), undressing and dressing, meal preparation (likes to have porridge for breakfast and a cup of tea with NO SUGAR DUE TO HER DIABETES.\r\n\r\n', 'Wolverhampton', 'Active', '#27ae60', '2024-04-02T12:03', '', 'd04bdc6a05adf24798095fdc26a3b534cfac4d73bfb0bd864244296c3d6a0bc4', 'Domiciliary care', 'Null', 'Null', '-', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6751857', '-1.9699316', '', '8605679', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(29, 'Mrs.', 'Pamela', 'Glover', '', 'Pamela', '', 'She/Her', '1950-04-18', 'Diagnosed with Liver failure', '1384877002', '', 'None', 'Female', 'Kinver', '80', 'High St, Kinver, Stourbridge ', 'Wolverhampton', 'West Midlands', 'DY7 6ES', 'United Kingdom', '-', 'Pamela lives with her husband in a house who is older and not able to support her with most of her needs.\r\nPG is independently mobile around her home by using furniture as support, Her home is not suitable for use of frame due to space. home is curently undergoing renovation, PG goes to stay in a temporary home until renovation is complete.\r\nPG does not have sugar with her drinks as a choice.\r\nPG is diagnosed with Liver failure, has a leg ulcer which is known to the district nurse for dressing.\r\nPG has lost a considerable amount of weight and does have supplements to help recovery. \r\nGP is classed as housebound by her GP as she is very unsteady on her feet.\r\nPG supports herself with her medication.\r\nPG is supported by single carers with personal care, clothes change, meals and drinks preparation.', 'Wolverhampton', 'Deceased', 'rgba(231, 76, 60,1.0)', '2024-06-17T12:38', '', '4f291b2163dc204a40807f5e3dbb27cd725380d93fd3a8918cf7438693f297bb', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.4498713', '-2.2300101', '', '4252569', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-17 08:34:41'),
(30, 'Miss.', 'Pamela', 'Haire', '', 'Pamela', '', 'She/Her', '1961-03-08', 'Hypotensive, Depression, Osteoarthritis, Psoriasis, falls.  ', '7518060941', '', 'None', 'Female', 'Walsall', '64', 'Brook Ln, Great Wyrley, Walsall ', 'Wolverhampton', 'West Midlands', 'WS6 6BL', 'United Kingdom', '1961- Key safe is at the top. Please do not enter via the back door.  I was employed as a Care Assistant working in  a residential care home. ', 'I was born in Lichfield. I live with my partner and I have two daughter but we have not seen or spoken in years.  I prefer to have a lunch call daily to be supported with  a shower or strip wash, change of clothes, apply cream require, assist with meal prep and prompt to take my medication. l do not feel I need any other care support as I can manage otherwise. I have a rescue pet dog called Suzie, she is friendly and harmless. ', 'Wolverhampton', 'Active', '#27ae60', '2024-01-29T12:58', '', '839b35356d99dafabcf3b8e977f624c45e2a7dc798a165e9ca48283569146e23', 'Domiciliary care', 'My partner is important to me and I have a close relationship with my partner\'s family. ', 'I do not have much dislikes, I am quite easy going.  I use like watching football, listening to reggae music and I like Animals. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6623921', '-2.0150237', '', '9845375', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(31, 'Ms.', 'Vera', 'Griffiths', '', 'Vera', 'widdowsonlinda2@gmail.com', 'She/Her', '1939-02-06', 'Dementia (disorder)', '7972890739', '01922412685', 'Other', 'Female', 'Great Wyrley', '28', 'Campian\'s Avenue, Cheslyn Hay, Walsall ', 'Wolverhampton', 'West Midlands', 'WS6 7HW', 'United Kingdom', 'Key Safe: 6239', 'Vera lives alone in a bungalow, she is a very nice lady who can communicate her needs; Vera has dementia, including Alzheimer\'s, and sometimes get confused about her needs. and will refuse requests to offer her meals.  Nevertheless, Vera will eat her meals when prepared and offered. It is advisable to offer Vera her meals, Vera prefers to have two slices of toast with butter for breakfast, ready-made meals to be microwaved and served in a nice plate at tea time and she often snacks at bed call, she likes coffee or cofeemate with a mug with and dog drawn on the mug. Vera has medications which are to be administered morning and bedtime. Vera needs to be prompted and encouraged to have her personal assistance with a change of clothes. Vera is independently mobile, she likes to go to the garden to feed the beds and does not go out to the front of her house. Vera goes out only with family to visit her husband who is in respite. Vera often gets confused and anxious because she thinks all the neighbours have left, carers to encourage that the neighbours have only gone out to work or they are inside their homes. Also Vera may be picky on the radiator because she thinks when they get too hot they will explode.\r\nVera has leg ulcers, and her legs are bandaged. Her caregivers must ensure that water does not get onto her legs. District nurses visit Vera twice weekly to treat and dress her legs. \r\nEncourage Vera to be independent. Vera could sometimes make her own bed, make a drink for herself, wash and change her clothes. Her daughter often leaves clean clothes by her bed every day. All her clothing is in her bedroom.\r\nDNAR is not in place.\r\nVera does \r\nEnsure door is locked with keys and keys are safely returned to key safe after every call.', 'Wolverhampton', 'Active', '#27ae60', '2024-01-11T14:05', '', '7179de6e453a7be4c1613972eed50224c90919d3b99cc10f3589c392f8203899', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6594627', '-2.0373771', '', '100493722', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(32, 'Mr.', 'Peter', 'Ford', '', 'Pete', '', 'He/Him', '1933-02-01', 'high risk of falling due to having Arthritis in the knees. ', '1543278438', '', 'Christianity', 'Male', 'Norton canes', '34', ' Bridges Cresent, Norton Canes  ', 'Wolverhampton', 'West Midlands', 'WS11 9PA', 'United Kingdom', '1680- key safe ', 'I live alone and I\'m a widower.  I have two sons but one sadly passed away. I have a close relationship with my other son Stuart. I used to work as carpenter.  I would like to take my medication at the same time each day. \r\nPeter is medication visit only. Please do not administer Furosemide (water tablet) if Peter has an appointment to prevent him from needing the toilet frequently when he goes out. Peter will say when he has an appointment, kindly note the name of the medication on the box. ', 'Wolverhampton', 'Left Service', 'rgba(142, 68, 173,1.0)', '2023-07-31T14:41', '', '2a54220349e185547927d90125176c7d0274579bc0adfbeb2c1ce2ee3e5fb066', 'Domiciliary care', 'My son Stuart is important to me.  My home and my garden is important to me. ', '\r\nI do not have much dislikes.  My hobbies were wood turning and silver shining. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6697526', '-1.9752228', '', '715418', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-17 08:43:06'),
(33, 'Mrs.', 'Phyllis', 'Taylor', '', 'Phyllis', '', 'She/Her', '1935-09-28', 'Dementia including Alzheimer\'s, Alzheimer\'s disease, Hypertension, Osteoarthritis, Osteoporosis, Left distal radius fracture. ', '1543503557', '', 'Christianity', 'Female', 'Cannock', '23', 'Goldthorne Ave, Cannock, Staffordshire, ', 'Wolverhampton', 'West Midlands', 'WS11 6LF', 'United Kingdom', '2586- key safe outside by side gate. ', 'I live with  my husband and I have two sons. I was born in Huntington and I move to Birmingham after I married my husband who is from Birmingham. I move back to Cannock in 1960 with my husband. My first job was working at Lotus shoe company as shoe maker. I then move on to work in a toy warehouse. ', 'Wolverhampton', 'Left Service', 'rgba(142, 68, 173,1.0)', '2024-02-02T15:12', '', '45fe9c0665a09481d37d89a06792dd13752829fca6ea38158307ecca3fa2889c', 'Sit-in Care', 'My Husband and my children are important to me.  I live with my husband who support me with some of daily needs. Barmouth is one of my favourite Place where I use to often go on holiday. ', 'I dislikes liars and arrogant people.  I used to enjoy swimming , dancing, and reading. ', 'Null', 'Dementia including Alzheimer\'s, Alzheimer\'s disease, Hypertension, Osteoarthritis, Osteoporosis, Left distal radius fracture. ', 'Null', 'Null', 'Null', 'Null', '', '', '52.6943117', '-2.0211802', '', '7156936', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 15:18:02'),
(34, 'Mrs.', 'Pritam', 'Kaur', '', 'Pritam', '', 'She/Her', '1927-01-01', 'Dementia, Blood pressure, Stroke, Osteo Arthritis, Spondylosis.  Pritam is bedbound an require to be nursed in bed.', '1922418997', '', 'None', 'Female', 'Walsall', '9', 'Bramwell Dr, Cheslyn Hay, Walsall ', 'Wolverhampton', 'West Midlands', 'WS6 7PQ', 'United Kingdom', 'No  Keysafe in place, family will open door on arrival. ', 'Pritam is unable to speak speak English and require Punjabi speaking care worker. \r\nPritam is bedbound an require to be nursed in bed, assist with full body bed in bed, pad change and catheter care. ', 'Wolverhampton', 'Deceased', 'rgba(231, 76, 60,1.0)', '2024-02-19T15:31', '', '4a844ad8321225e3d0dc2cc1288f6a5f280ce6e825f01469f240b5b7ec9869f0', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6521271', '-2.0359575', '', '6070552', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-17 08:45:33'),
(35, 'Mr.', 'Richard', ' Taylor', '', 'Richard', '', 'He/Him', '1942-06-16', '-', '1902700049', '', 'None', 'Male', 'Pattingham', '24', 'Rudge Road, Pattingham,', 'Wolverhampton', 'West Midlands', 'WV6 7BT', 'United Kingdom', '-', '-', 'Wolverhampton', 'Active', '#27ae60', '2021-09-29T15:52', '', 'aedf6926ca6e59aa789b146680b077e1e9642f4ca1cfe83caf40cb5cc1f1ea34', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.5851033', '-2.2692195', '', '6070833', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(36, 'Mr.', 'Terence', 'Darby', '', 'Terence', '', 'He/Him', '1939-10-23', ' Parkinsons disease', '1384873367', '07967413163', 'Christianity', 'Male', 'Kinver', '12', 'Cedar Gardens, Stourbridge, Staffordshire', 'Wolverhampton', 'West Midlands', 'DY7 6BW', 'United Kingdom', 'No key safe: Wife is always in to let carers into the property.\r\nLocation of property: Houses in the street are not serially numbered, property, number 12 is opposite house number 1 on the street. \r\nEntrance door is at the right side of the property. ring the door bell for wife to let carer in. \r\n', 'Terence likes to be called Terry, is a lovely elderly man who is being cared for from the bed due to his present health conditions. \r\nTerry lives with wife in a bungallow with nice and lovely neighbours as wife has explained. Terry has two children who visits and keep in contact regularly.\r\nTerry\'s Parkinsons sometimes makes it difficult to handle objects like cutleries, wife often feeds him. On a good day Terry is able to hold his toast or sandwich.\r\nLays in a hopital bed with bed rails which must always be raised to prevent Terry from falling out of his bed. has e-motions sheet and kylie in place which should be changed when required.\r\nTerry is double incontinent: wears pads which should be checked at all calls and changed when required (Changed pad at morning and bed calls after personal care and freshening up respectively)\r\nTerry is to be supported with a strip wash in bed (Rolling on bed by 2 carers), change into clean clothes and repositioned up or down in bed with the e-motion sheet. Terry does not have any pressure sores and would like to maintain his good skin integrity with his creams been applied regularly.\r\n\r\nTerry has specific flannels for face washing and another for washing his body.\r\nsupport with a shave as scheduled using his electric shaver.\r\nWife (Marion) supports Terry with meals and medication.\r\nCarers to support with creams as required - legs and back.', 'Wolverhampton', 'Active', '#27ae60', '2024-05-01T16:04', '2025-05-01T16:05', 'a8d9cc0a927ce5ebd9228daf027e7c4395cb4ea88928c9b7985e490fcb7fb9ac', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.4591458', '-2.2368871', '', '6053319', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(37, 'Mr.', 'Richard', ' Astbury', '', 'Richard', '', 'He/Him', '1953-02-27', 'Parkinson\'s disease, Dementia, Diabetes and Arthritis. ', '1543320970', '', 'Christianity', 'Male', 'Cannock', '63', 'High St, Norton Canes, Cannock ', 'Wolverhampton', 'West Midlands', 'WS11 9QQ', 'United Kingdom', '-', 'I live with my wife who I\'m married to for 41 years. I was born in Burnley and i move to Norton Canes Cannock when I was 17 years old. I worker as Welder and a lorry driver. I also worked the Art foundation in Wolverhampton for 11 years.  I prefer my wife to continue supporting me with my personal care needs as I do not feel comfortable to have regular carers. \r\n', 'Wolverhampton', 'Active', '#27ae60', '2024-02-08T16:14', '', '0ce3bbbbbec2ee3009271f1422179a6ea8211d5d613750a17f46c213177c69c7', 'Sit-in Care', 'My favourite person is my grandson, his name is Taylor. we have a lot in common. However, my other family members are important to me. ', 'I am quite laidback and easy going. I do not have much dislikes.  My hobbies were collecting fish for my fish pond in the garden and collecting parrot birds. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6710237', '-1.9601034', '', '9626946', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
