(42, 'Mr.', 'Gurjit', 'Singh', '', 'Gurjit', 'neelam2002000@yahoo.co.uk', 'He/Him', '1979-05-31', ' Craniotomy (procedure) Ankle clonus (finding) Subarachnoid hemorrhage Left transient visual loss DM - Diabetes mellitus Hemiplegia (paralysis on one side) Hypotension', '7577452854', '', 'Sikhism', 'Male', 'Pattingham', '3', 'Raglan Avenue, Perton ', 'Wolverhampton', 'West Midlands', 'WV6 7RZ', 'United Kingdom', 'A7462 - Key safe, ensure to lock the door after every visit, return key to the safe and shuffle code before leaving. ', 'Gurjit was born in India and lived in England since 2008. I live with my wife and two children. My health and my independence are important to me. \r\nMedical History- Recently diagnosed with PTSD (Post Traumatic Stress Disorder), which can be triggered when Gurjit becomes anxious when worrying about having a seizure; kindly give reassurance when Gurjit is feels anxious. Craniotomy, Subluxed shoulder, Clonus in the ankle, Subarachnoid haemorrhage, left side visual loss, Diabetes, Hemiplegia, Hypotension (low blood pressure. \r\nGurjit suffers from seizures; he also wears a splint on his arms and leg boots, which carers should put on after personal care daily. Carers to ensure arm exercise is completed as instructed daily. Gurjit lives with my wife and two children. My health and my independence are important to me', 'Wolverhampton', 'Active', '#27ae60', '2023-01-17T09:34', '2025-01-17T09:34', '5dc647ecc88a4223b39cb46aacfea9291ce16c06e9c84dc29085eb6caadaef77', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.5913188', '-2.1961642', '', '100450167', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(43, 'Mrs.', 'Sylvia', 'Cross', '', 'Sylvia', 'carolpacey@btinternet.com', 'She/Her', '1944-09-27', 'Mixed Dementia, Diabetes (type 2)', '01543371191', '07955838107', 'Christianity', 'Female', 'Cannock', '23', 'Westwick Cl, Walsall, Staffordshire, ', 'Wolverhampton', 'West Midlands', 'WS9 9EA', 'United Kingdom', 'Key safe: 1963.Location: The Key safe is just inside the porch. open the front porch door to see the key safe by your right.  key safe contain entrance door key and key to medication safe, pls use and return to the safe', 'Sylvia  is a happy and chatty elderly woman.\r\nDNAR:NO\r\nSYLVIA IS VEGETARIAN: Do not offer none vegetarian diet\r\nLives with husband (also been cared for) in their home.\r\ndiagnosed with Mixed Dementia, Diabetes (type 2).\r\nWears slip pad for precautionary purpose and requires encouragement to use the toilet then check and support to change pad when required, communicates verbally and could be confused most of the time, requires encouragement to complete all task, encourage to promote her independence.\r\nBedroom and washroom is upstairs, clothes and pads are in bedroom.\r\nTask:\r\nSupport with personal care (Daily wash) upstairs using with two bowls and two flannels in the bathroom upstairs. check skin intergrity.\r\nDark coloured bowl and dark coloured flannel is for lower body.\r\nBright coloured bowl and flannel is for face and upper body parts.\r\napply barrier cream and support with putting on clean clothes which should be changed when dirty at any call. support with freshen up (wash private areas) and change into nighty at bed call. On bath days as scheduled, daughter will be present to support with the bath.\r\nMeal Preparation: Family has labelled items in fridge stating items for Mary seperated from husband. Mary is vegetarian so do not use husband\'s items to make Mary\'s sandwich. top kitchen cupboard has sticky notes on how to make her meals or sandwiches and must be followed, ready meals for Mary are labelled in fridge. Bananas and cakes are kept in the pantry storage in kitchen on your right. sometime daughter may prepare and leave meal in the fridge for carer to heat up for Mary.\r\nPrepare and leave sandwich for tea time in the fridge during lunch call (instructions is posted on the cupboard in kitchen and ensure sandwich is wrapped with films that is kept in the pantry and stick label on the film with Mary\'s name on it. Ensure a drink of squash or juice is left with before leaving at every call.\r\n laundry room is assessible from kitchen next to the garage. do not mix heavily soiled linens with lightly soiled linens, soak heavily soiled linen in soak bowls in the washroom downstairs.\r\nDRINKS: likes coffee, squash, black currant (check the fridge). do not offer sugar\r\nMary attends church every Sunday, and must be ready before 09:30 for transport . \r\nMEDICATIONS: Medications are locked in a red safe and kept on top the kitchen cupboard out of Mary\'s reach, key to medication safe is in the key safe. all medications are in the blister pack except the barrier cream. click blister pack in app to see medication. ', 'Wolverhampton', 'Active', '#27ae60', '2024-04-22T09:47', '', 'cda4faef51ffd5c5254ff8dec176aa38227cd3786535d4623490eefe7d1d4753', 'Domiciliary care', 'My husband, daughters and my general wellbeing is very important to me.', 'I am a vegetarian.  I prefer to be supported by Female carers only.', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6327396', '-1.8946655', '', '9784074', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(44, 'Ms.', 'Gwenyth', 'Smith', '', 'Ruth', 'riasushi@yahoo.com', 'She/Her', '1939-08-12', 'Alzheimer', '1922415293', '07740621375', 'Christianity', 'Female', 'Great Wyrley', '129', 'Walsall Road, , Great Wyrley,', 'Wolverhampton', 'West Midlands', 'WS6 6LB', 'United Kingdom', '249A- key safe to the left side of property on wall. Ensure to lock inside entrance door and outside door with key before exiting. ', 'Likes to be called Ruth. Ruth has Alzheimer\'s and can become confused at times. She also struggles with anxiety, which is medicated controlled. Ruth is Mobile. \r\nRuth sometimes takes off her hearing aid which leads to it been misplaced. ensure to attach hearing aid to the lanyard and clip to her bra strp so that she will not loose it.\r\nPLEASE PUT BATTERY OPERATING HEARING AID IN DURING THE DAY  REMOVE  AT NIGHT AND PUT IN CUPBOARD IN THE KITCHEN NEXT TO OVEN COOKER ON TOP SHELF. \r\n>MORNING- Ruth has a shower on Tuesday and Saturday, please support her to switch the shower on and off once she finish showering. Assist to give her a wash other days in the week, Change clothes and sanitary pad, ensure to dispose of pads appropriately. Administer medication, meds are kept in cupboard in the kitchen, please check and follow the MAR chart. Prepare breakfast of choice.  Ruth is vegetarian and is on a vegetarian diet. A list of meals she prefer is attached to the cupboard in the kitchen, check with Ruth what she would like to eat from the list and prepare. prepare a meal and leave for her to have at lunch. Tidy area used and lock door before exiting. \r\nTEA- assist to dispose of sanitary pads if Ruth changes pad. Prepare hot meal and drink of choice. Administer medication due. Tidy area used.  Remove hearing in the evening and put aids on top shelf in cupboard by oven cooker in the kitchen. ', 'Wolverhampton', 'Other', 'rgba(211, 84, 0,1.0)', '2023-07-20T10:29', '2025-07-20T10:29', 'd96e67264bdf1845bc91ace30e597b6fded9c6af1cb9643a372b2dc7b94ac751', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6660772', '-2.0153626', '', '6066506', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-16 09:39:31'),
(45, 'Mrs.', 'Beryl', ' Wells', '', ' Beryl', '', 'She/Her', '1937-09-28', 'Vascular dementia, Rheumatoid arthritis with arteritis', '7759937305', '', 'None', 'Female', 'ST', '23', 'Clive Road , Newcastle under Lyme ', 'Stoke on Trent', 'Staffordshire', 'ST5 0BN', 'United Kingdom', '\r\nHusband will open door, no key safe. ', 'N/A', 'Stoke on Trent', 'Left Service', 'rgba(142, 68, 173,1.0)', '2024-05-04T10:31', '2024-06-24T10:32', '13bcdd0c055d456d1bd2f615fcd7961e58b2af426ecd936d1112f222ce409151', 'Domiciliary care', '\r\nMy family is important to me. ', '\r\nI dislike loud noises. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '53.0343315', '-2.2142836', '', '9771152', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-17 11:14:28'),
(46, 'Ms.', 'Heather', 'Inskip', '', 'Heather', 'heatherfud@hotmail.co.uk', 'She/Her', '1970-01-06', 'Cancer', '1543523159', '07960622285', 'Christianity', 'Female', 'Burntwood', '13', 'Woodland Way, Burntwood, Staffordshire', 'Wolverhampton', 'West Midlands', 'WS7 4UP', 'United Kingdom', 'Key safe: 4613.\r\nLocation: by the entrance door.', 'Heather is a nice chatty lady who lives with her partner in their house with 2 cats.\r\nHusband is currently in the hospital after cancer diagnosis.\r\nLocation of property: Walk through the tiny pathway opposite house number 14 in woodland way, just by the road side car park.\r\nAt the end of pathway, turn left and walk left, house number 13 is by your right.\r\nHeather is often sat in the lounge or may be upstairs if in the toilet.\r\nring the door bell and check if door is already opened as she often keeps the door opened when expecting carers. Heather likes to sleep in lounge recliner chairs\r\nShe administers her medications by herself, carers support with creams\r\nShe likes to have her shower daily to maintain her personal hygiene.\r\nSlowly mobile with a rollator 4 wheeled frame with hand brakes.\r\nCommunicates verbally.\r\nUrine incontinent: support with slip pad change.\r\nAccesses shower upstairs through a ceiling lift which she uses independently.\r\ngrab rails and shower chairs in the wet room.\r\nEnsure door is locked and keys returned to the key safe when leaving.', 'Wolverhampton', 'Active', '#27ae60', '2024-04-23T11:51', '2025-04-23T11:51', '8cbeb90fde01e09d6443e68c8ade23094709eb1077c6fcb2a1fed488daf5d381', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6764426', '-1.9217334', '', '100418990', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(47, 'Ms.', 'Helen', 'Gardiner', '', 'Lorraine', '', 'She/Her', '1945-07-12', ' Arthritis Tuberous sclerosis', '1543878845', '', 'None', 'Female', 'Hednesford', '8', 'Plantation Road', 'Wolverhampton', 'West Midlands', 'WS12 4LH', 'United Kingdom', '2617- key safe ', 'Please be mindful Helen smokes heavily.\r\nShe has limited mobility but able to stand for a short period. \r\nSupport to give wash, pad change, change nightie, apply barrier cream, administer medication, assist to used the commode, empty and clean commode, medication box is in the kitchen on counter, check and follow mar chart, prepare meals and drinks of choice. Change bedding if required, put dirty laundry in brown basket in the kitchen. Tidy areas used and ensure to lock door before leaving. ', 'Wolverhampton', 'Active', '#27ae60', '2023-06-23T12:38', '2025-06-23T12:38', '058c8c1f9635fc72fe34b22f0d179657958da69bf1323117531c0b4ee1d12d23', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.5868159', '-2.1256587', '', '7221673', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
