(54, 'Ms.', 'Joan', 'Newton', '', 'Margaret', '', 'She/Her', '1934-04-07', 'None', '1543278147', '', 'None', 'Female', 'Cannock', '32', 'Bridges Crescent,, Norton Canes,, Cannock, WS11 9PA', 'Wolverhampton', 'West Midlands', 'WS11 9PA', 'United Kingdom', '0305- key safe on left side of the property.', '\r\nJoan lunch call on a Friday is a cleaning call to clean her house. Areas to clean are \r\n>upstairs toilet\r\n>kitchen surface and cupboard doors. \r\n>Hallway \r\n>living room where Joan sleeps. ', 'Wolverhampton', 'Active', '#27ae60', '2022-01-21T16:20', '2025-01-21T16:20', 'ce1359421d1d692493b5781e33bdb5afdf718eedce074311c2d9e2d442a1e425', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6698308', '-1.9755108', '', '9840166', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(55, 'Mr.', 'William', ' McColm', '', ' William', '', 'He/Him', '1934-08-12', ' Difficulty hearing, Deteriorating vision', '1782620001', '', 'Other', 'Male', 'ST', '10', 'Richmond Grove, Newcastle-under-Lyme', 'Stoke on Trent', 'Staffordshire', 'ST5 0LF', 'United Kingdom', '0107', 'n/a', 'Stoke on Trent', 'Other', 'rgba(211, 84, 0,1.0)', '2024-06-20T16:39', '', '0a5cf8ee79f4683ab7aa2908c42992ced92ef8775c0e07853d8d48edc5d4967b', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '53.0208589', '-2.2091074', '', ' 100496285', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-18 09:53:46'),
(56, 'Ms.', 'Janet', ' Harris', '', 'Janet', '', 'She/Her', '1945-05-07', 'Hypertension, Fractured knee cap and hip, Diphtheria (age 3), Dementia', '7827319663', '', 'Christianity', 'Female', 'Walsall', '41', 'Manor avenue ', 'Wolverhampton', 'West Midlands', 'WS6 6NS', 'United Kingdom', '1971- Key safe ', 'I live alone in a house with my pet cat. I was born at Walsall Manor Hospital. I was employed as a factory worker at BRD, Aldridge. Janet has Dementia however is capable to choose what she likes regarding her care needs, she is mobile, however spend most of her time in the bedroom. \r\nMORNING- assist to give full body wash or monitor when having a shower, JH is able to wash upper body. Change clothes daily, JH uses the toilet independently. Administer medication, medication is kept in the bedroom in chest of drawers. Spare medication at usually kept in the same Drawers. follow MAR chart for guidance. prepare breakfast of choice. Tidy bed and areas used. \r\nLUNCH & TEA- Prepare meal and drink of choice. Tidy areas used and wash dishes up. \r\nBED CALL- Assist to change into night wear required. Prepare hot chocolate, ensure to tidy areas used and secure property before leaving.   I require to be ready in the morning by 8:30 to attend day centre Monday to Friday each week. ', 'Wolverhampton', 'Left Service', 'rgba(142, 68, 173,1.0)', '2023-03-24T16:46', '', 'f34975ac2e89b2b5d07aff4e4478dc65e56c2fc8f1f46ff906c7944916d0e722', 'Domiciliary care', 'My grandson Nathan and my sister are important to me.  My home is important to me as well and I wish to remain living at home for as long as possible. ', 'I do not have much dislikes. I enjoy spending quality time with my younger sister who visits occasionally for 1-2 weeks. My younger sister and I used to travel everywhere together. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.610774', '-2.1343283', '', '100471802', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-16 10:43:46'