(103, 'Mr.', 'Frederick', 'Maxfield', '', 'Frederick', '', 'He/Him', '1946-06-15', '-', '178 278 7117', '', 'None', 'Male', 'ST', '14', 'Pine Cl, Talke, Stoke-on-Trent ', 'Stoke on Trent', 'West Midlands', 'ST7 1PJ', 'United Kingdom', '15064', '1. Kindly access home via key \r\n2. Introduce yourself on entering the house\r\n3. Allow privacy when needed\r\n4. Assist to shower and change into new clothes\r\n5. Prepare breakfast, lunch and tea.\r\n6. Open blinds in the morning and close at tea call\r\n7. Ensure to put off lights at bed call\r\n8. Ask if further assistance is required.\r\nIN EMERGENCY:\r\na. Call 999/111\r\nb. Son- Matthew-07810216016\r\nc. OnCall Line', 'Stoke on Trent', 'Active', 'rgba(39, 174, 96,1.0)', '23.10.2024', '', 'be7f56abd8c3e3933473e4ec6a8cf0b0007255876472a31e26d345b292a486fc', '', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '53.0742089', '-2.2620597', '', '2462037', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-30 11:08:53'),
