(105, 'Ms.', 'Christine', 'Carter', '', 'Christine', 'Christa831@outlook.com', 'She/Her', '1932-11-21', 'Poor mobility', '138 491 0242', '', 'Christianity', 'Female', 'Kinver', '29', 'Huntsman Dr, Stourbridge, Staffordshire', 'Wolverhampton', 'West Midlands', 'DY7 6BA', 'United Kingdom', 'Key safe: not currently in use. carers to ring the door bell and wait patiently for CC to open the door.location: bungalow is located next to house number 31 (opposite house number 20). there is a big tree in front of the house, with a road side parking space. walk towards the house over a little field, you will find the short wooden gate with number 29 on it (not very visible from distant) open the gate and walk in through the front garden, entrance door is by the left side of building. press', 'CC is a 91 year old lady who looks very strong, \r\nI used to work as a carer in a hospital many years ago. I have 8 children who live in different parts of the world. I currently live alone as family likes far. she is always in touch with family though the comms which she use for video communication anytime she likes. full mental capacity, communicates verbally and likes to chat, independently slowly mobile within her home by holding onto furniture. CC does not like to be hurried with her personal care due to her frailty and she wants carers to spent her complete time with her at all calls. supports herself with her medication from blister pack and pain killer from original packet, requires prompting to take her medication at all call. support with personal care as required, shower or wash: support to sit safely on shower chair and hold shower spray for her while she washes self, support to was hard to reach areas. support safely out of shower by ensuring shower floor is dried before she stands up, assist to dress up. support to wear her knee support and hand gloves. assist with massage of hands, knees and other areas with her cream scheduled in app.\r\nCC wears denture, support to put denture in sterodent liquid at bed call and wash and hand back to her at morning call. family does her shopping, assist to arrange and put shoppings away when delivered. assist with laundry, linning washed clothes and bringing back in when dry.\r\nCC likes her bed well made daily.\r\nAssist with a like freshen up wash at bed call and change into nightie.\r\nAT bed call, ensure back door is locked, all windows are closed and curtains are closed as she is not able to reach them and open curtains at morning calls.\r\nEnsure life pendant is worn every morning.', 'Wolverhampton', 'Active', '#27ae60', '2024-07-23T 19:00', '', 'ad4d117a4d77db7f76f192f80496d473880c7997473e1de794291ca696d85756', '', 'My family is very important to me and I like to keep in touch with them even when they live far from me.', 'I like to sit out in my garden, watch TV (wild life channels), listen to flute music, news. and go out on my wheel chair with my family. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.456891', '-2.148731', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(106, 'Mr.', 'Alfred', 'Malpass', '', 'Alfred', '', 'He/Him', '1935-03-03', 'Cancer of prostate, Weak heart, Poor mobility, Breathlessness', '178 266 0740', '', 'None', 'Male', 'ST', '244', 'Fearns Ave, Newcastle-under-Lyme, Newcastle ', 'Stoke on Trent', 'West Midlands', 'ST5 8LS', 'United Kingdom', '4577', '1. Son-Andrew-07415157312\r\n2. Daughter In law-Joanne-07952956508\r\n3.Social Worker-Kay-07967334161\r\n4. He is frail please ensure he uses his walking stick and let him catch some breath at every point.\r\n5.Allow him as much independence as he would like, but keep a close watch because he is prone to falling.', 'Stoke on Trent', 'Deceased', 'rgba(231, 76, 60,1.0)', '2024-07-29T10:34', '', '9ea6343c99c8bf4a51ea7790eb913633d4f68a9e26ede03a5c5a726d4361a53e', '', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '53.0463168', '-2.2324507', '', '4744323391', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-17 10:42:45'),
(107, 'Mr.', 'Graham', 'Kelshaw', '', 'Graham', '', 'He/Him', '1939-05-07', 'Diagnosed of Heart failure and bleeding in the brain after a fall about 2 months ago.', '190 284 2879', '+447940208018', 'None', 'Male', 'Codsall', '36', 'Heath Farm Rd, Codsall, Wolverhampton ', 'Wolverhampton', 'West Midlands', 'WV8 1HT', 'United Kingdom', 'Key safe: C3541#  Location: Key safe is located at right side wall of the building', 'Graham is an elderly man with full mental capacity. \r\nDNAR: NO\r\nDiagnosed of Heart failure and bleeding in the brain after a fall about 2 months ago.\r\nIndependently mobile with frame, requires carer to walk behind when mobilising.\r\nGK likes to remain upstair in bed, carers must encourage to come out of bed and to encourage to stand and mobilse as exercise at every call. Promote independence and seek consent before completeing every task\r\nRequires encouragement with fluid. \r\nlikes porrige, cereal for breakfast, sandwich for lunch or tea, ready meals for tea or lunch.\r\nPrepare meals with fluid, likes water or tea (no sugar), requires encouragement with fluid.\r\nCatheterised, support with cartherter care. report ant concern. ensure to connect night bag at bed call and disconect at morning call. Change catherter weekly. administer medications, all medications are in original packet. NOTE Atorvastatin 20mg is for AM and Atorvastatin 10mg for night time. NOTE: Administer Lansoprazole on arrival befor any other task and the other medications after other completed tasks. Medication is kept in the landing upstairs.\r\n encourage and Support with shower Wednesdays, Fridays and Sundays.\r\nEncourage to sit on presure cussion.\r\nDouble continent but may have accident sometimes.-', 'Wolverhampton', 'Active', '#27ae60', '2024-07-31T12:55', '', '13cb5a0efdfb82b3faf20b1b3f625abf69c64054687344752c4a61ac7862349c', '', 'Null', 'Null', 'Null', 'HF - Heart failure', 'Null', 'Null', 'Null', 'Null', '', '', '52.623613', '-2.1838209', '', '100517539', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(108, 'Mrs.', 'Kathleen', 'Kelshaw', '', 'Kathleen', '', 'She/Her', '1939-11-26', 'diagnosed with ANXIETY.', '190 282 0228', '+447756330161', 'None', 'Female', 'Codsall', '36', 'Heath Farm Rd, Codsall, Wolverhampton ', 'Wolverhampton', 'West Midlands', 'WV8 1HT', 'United Kingdom', 'Key safe: C3541# Location: Key safe is located at right side wall of the building', 'Kathleen is an elderly lady, \r\nDNAR:NO.\r\nKK is diagnosed with ANXIETY.\r\neasily gets anxious when her expectations are not met, when she has not decided what to have for breakfast. carer must engage in conversation, pin calm voice, listen to her and encourage. likes to chat with carers but does not like noise. independently mobile, used to be very independent. carer must continue to promote her independence by encouraging to come to kitchen to prepare meal when her anxiety is not high.KK administers her medication by herself.\r\nKK requires support with personal care, clothes change, meal  preparation and washing and spreading the laundry. carer must remind to wash the bathroom towels weekly. likes porrige, cereal for breakfast, sandwich for lunch or tea, ready meals for tea or lunch.\r\nKK likes to shower daily. like tea (No sugar) a lot of water and sometimes drink coffee.', 'Wolverhampton', 'Active', '#27ae60', '2024-07-31T13:00', '', '9fae5d82ab5caf990547ab9907bf4f614149a3299ea6067fdfc43449ab6d7984', '', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.623613', '-2.1838209', '', '100513616', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(109, 'Mr.', 'Ronald', 'Simcock', '', 'Ron', '', 'He/Him', '1940-04-12', '-', '190 276 3115', '', 'None', 'Male', 'Kinver', '5', 'Drive Fields, Wolverhampton ', 'Wolverhampton', 'West Midlands', 'WV4 4XY', 'United Kingdom', 'LOCK CODE : 0440', 'Ronald Simcock, preferred to be called Ron lives alone in semi detached house, though Ron\'s Children often visit frequently to support his care. The front door serves as the main entrance to the apartment.Key lock is behind the waste bin, on the wall - Lock Code is 0440. Ron needs carer to assist him every morning to empty, dispose and replace night catheter bag; there are rolls of mini sized black waste bag in his room for discarding used night catheter bags . Carer should endeavor to assist Ron with daily body wash and full shower on Wednesdays.\r\nRon wants carer to focus attention on washing/ applying cream on his feet and changing his socks with a clean one. Carer should also assist Ron by applying cream on sore areas(bum and back) Ron has capacity to administer his other medications and prepare his meals. \r\nRon likes to watch television and walk short distances in the building premises. Carers should carefully lift the inner entrance door while opening to exit the apartment.', 'Wolverhampton', 'Active', '#27ae60', '2024-07-30T09:29', '', 'da9dc5bde32d5f4835f0a9dc282b6e1bd524c28d5fb0ac1c328bb3417d9342c0', '', 'Children', 'Ron was an active football player and likes to keep his garden in good shape. \r\nRon likes to sleep in his bedroom and have his body washed in the bathroom upstairs. Ron is not an early riser and prefers watching sport programs on the TV during the day.', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.5682588', '-2.1820262', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
