(115, 'Mr.', 'John', 'Till', '', 'John', '', 'He/Him', '1939-07-12', 'has dementia', '154 332 6545', '+447745160535', 'None', 'Male', 'Burntwood', '18', 'Glenmore Ave, Burntwood ', 'Wolverhampton', 'West Midlands', 'WS7 4UW', 'United Kingdom', 'Key safe: 0000 Keysafe location: key safe is on wall at right side of property by the side fence. Go through the little wooden gate. the key is for the first porch door, the inner door is not locked. knock on arrival and alart John when arrived.\r\nproperty location: stop at house number 28 on the right, number 18 is the last house in the same building as house number 28.', 'John lives alone in his house, he likes to chat with carers, has mental capacity.\r\nDNAR: YES.\r\n has dementia, independently mobile with stick or frame, microwaves his meal by self. medication is kept on the table in the dinning (Blister pack and original packets (cocodamol and ADcal 3 are in original packets)', 'Wolverhampton', 'Other', 'rgba(211, 84, 0,1.0)', '2024-09-02T10:00', '', '88a3cb3e37527e3ba5e11a1b1056286b7732e8a2ea8611f6425869d47383b81b', '', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6781772', '-1.9204949', '', '100482262', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-21 09:51:39'),
(116, 'Ms.', 'Joan', 'Collins', '', 'Joan', '', 'She/Her', '1933-08-04', '-', '745 059 4813', '+447450594813', 'None', 'Female', 'Kinver', '6', 'White Row, Wolverhampton, Staffordshire', 'Wolverhampton', 'West Midlands', 'WV5 7JF', 'United Kingdom', 'Knock at the door for JC to open. Location of property (bungalow): when you get to the Allsaints church At Seisdon road, you will find Primrose cottage adjacent to the church on your right. white row is a small compound opposite Primrose cottage which is a building along the road with a black wooden pane with SSSSSS sign on the building. Enter into white row compound and walk in straight, You will find house number 6 just in front of you.', 'JC lives alone in a bungalow inside white row compound. Ensure to keep medication away from JC after administering. keep the medication on top the kitchen cabinet just above the microwave.\r\nSupport with personal care , dress up, oral care, meal preparation, medication administration and make ready for her transport to go to the day centre.', 'Wolverhampton', 'Left Service', 'rgba(142, 68, 173,1.0)', '2024-09-03T12:19', '', '6b8bce544be0211d1ad558c49cc55becf008f1ac1d9eba7d7363fce7cda462d1', '', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.545823', '-2.2217364', '', '6057923', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 15:17:17'),
(117, 'Mr.', 'Brian', 'Frost', '', 'Brian', '', 'He/Him', '1940-10-08', 'Dementia', '178 265 3171', '', 'None', 'Male', 'ST', '18', 'Stanton Cl, Newcastle ', 'Stoke on Trent', 'West Midlands', 'ST5 6EZ', 'United Kingdom', '-', '1. He has dementia\r\n2. He has medications\r\n3. He has 2 types of eye drops (1 is to be used once a day and the other 3x) to the left eye.\r\n4. Encourage independence\r\n4. Call: 999/111/family and on Call.\r\n***Margaret-01782874527 (wife)\r\n***Janet-07757458871 (daughter)\r\n***He likes early call and late bed calls.', 'Stoke on Trent', 'Left Service', 'rgba(142, 68, 173,1.0)', '2024-08-27T10:30', '', '2566bf52e63785eca88b6b637dc0d4b7063b20c2a8facb8d926d073fdb5c76e6', '', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '53.0164171', '-2.2447046', '', '4740699605', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-17 11:40:15'),
(118, 'Ms.', 'Gwendoline', 'Drane', '', 'Gwen', 'mharman880@google.com', 'She/Her', '1939-03-13', '-', '781 856 2906', '+441543321265', 'Christianity', 'Female', 'Cannock', '167', 'Burntwood Rd, Norton Canes, Cannock, Staffordshire', 'Wolverhampton', 'West Midlands', 'WS11 9RN', 'United Kingdom', '-', 'I am Gwendoline Drane, but I preferred to be called Gwen. I use to work as a carer, but I now live with my son Christopher, my grand son and my daughter- Law. Carers are free to knock on the door and walk in to support me with personal care in my bedroom at bed calls. All Items needed for my care are always placed in the bedroom, including my nightie. I am capable of walking short distance and I have the wall railings to support my mobility in the lobby. I am able to communicate verbally but I sometimes experience Mild short term memory loss. My family members support me with drink, meal preparation and medication.', 'Wolverhampton', 'Left Service', 'rgba(142, 68, 173,1.0)', '2024-09-05T10:30', '', '1023', '', 'My Son', 'going to the garden, stable, and the gym', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6803305', '-1.9632842', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-16 09:38:38'),
(119, 'Ms.', 'Linda', 'Challenger', '', 'Lin', '', 'She/Her', '1949-05-12', 'Bed bound', '798 366 4472', '+447557024974', 'Christianity', 'Female', 'Codsall', '42', 'Suckling Green Ln, Codsall', 'Wolverhampton', 'West Midlands', 'WV8 2BT', 'United Kingdom', 'Key Safe: 9816', 'I am Linda Challenger, you can call me Lin. I use to work in an office for many years and ended up supporting the family by bring up the children, but I now live with my son and grand daughter. I am bed bound due to my current health condition of Parkinson disease, arthritis. I also have history of  strokes and kidney stone. I experience mild short term memory loss.\r\nCarers are free to pop in through the front entrance door. key is in the key safe beside the door- CODE 9815. I want carers to support me with personal care, prompt me with oral care, incontinent and cloth change. Family member support me with meal/drink preparation and medication.\r\n ', 'Wolverhampton', 'Active', '#27ae60', '2024-09-05T11:00', '', '1024', 'Domiciliary care', 'My Family', 'I like to see carers supporting me to be happy and smiling and I dislike aggressive people. I also despise argument. ', 'Null', 'Parkinson disease\r\nArthritis\r\nStroke\r\nKidney stone (disorder)', 'Null', 'Null', 'Null', 'Null', '', '', '52.6213919', '-2.1949718', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09');
