(120, 'Mr.', 'Malcolm', 'Walker', '', 'Malcolm', 'tracy.golding69@hotmail.co.uk', 'He/Him', '1943-06-06', 'Bed bound', '190 275 4403', '', 'Christianity', 'Male', 'Pattingham', '1', 'Penda Grove, Wolverhampton, Staffordshire ', 'Wolverhampton', 'West Midlands', 'WV6 7NW', 'United Kingdom', 'knock and wife will let you in.', 'Malcolm lives in his home with his wife.\r\nMW is frail and bed bound. all care are to be done in bed. 2 carers to support with rolling to dress and undress and strip wash in bed. MW can communicate verbally carers must speak loud and slowly for MW to understand. MW likes to maintain his independence, carer must seek consent before completing all tasks. MW has got dressings in both heels due to plessure ulcer, carer to ensure to keep dressings dry and elevate legs with soft cushion to prevent heels from resting on bed. apply prescribed creams as required. and make comfortable in bed, encourage and support to put on hand pad in left hand to keep palm opened. Mw is catheterised. support with cathter car by emptying bag at all calls, monitor catheter and ensure flow, change catheter as when scheduled, connect night bag at bed calls, monitor pressure areas and skin integrity, use slide sheet to reposition up in bed at all calls to prevent feet from resting on base board of bed. document volume of catheter fluid output at all calls. wife supports with meals and feeding.\r\nMW is diagnosed of diabetes, high blood pressure, swallowing difficulty, MW is on level 6 diet and level 2 fluid.', 'Wolverhampton', 'Other', 'rgba(211, 84, 0,1.0)', '2024-09-11T10:00', '', '1025', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.5979156', '-2.1985881', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-16 13:29:36'),
(121, 'Mrs.', 'Dawn', 'Brickell', '', 'Dawn', '', 'She/Her', '1957-09-20', 'has Schizoaffective disorder', '178 263 8814', '', 'None', 'Female', 'ST', 'FLOOR 3', 'HOLBORN PLACE, Hall St., Newcastle, Staffordshire', 'Stoke on Trent', 'West Midlands', 'ST5 2RZ', 'United Kingdom', 'ENTER LIFT: PRESS FLOOR 3\r\nWHEN YOU GET TO THE 3RD FLOOR, THERE IS A PAD BY THE DOOR DIAL 88# AND SHE WOULD ANSWER YOU.', '1. Has Schizoaffective disorder\r\n2.When unwell can be aggressive and threats with violence.\r\n3. When unwell can be verbally hostile and racist to professionals\r\n4. Has history of non complaint with medications and non engagement.\r\n5. Has mood stabilising medications\r\n***Social Worker: Siobhan IIsley -  03004042991\r\n*** Emergency: 111/999\r\n\r\nENTER LIFT: PRESS FLOOR 3\r\nWHEN YOU GET TO THE 3RD FLOOR, THERE IS A PAD BY THE DOOR DIAL 88# AND SHE WOULD ANSWER YOU.', 'Stoke on Trent', 'Permanent', 'rgba(52, 31, 151,1.0)', '2024-09-11T12:00', '', '1026', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '53.0140166', '-2.2315192', '', '4487815975', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-11-05 10:37:06'),
(122, 'Mr.', 'Robert', 'Winn', 'Anthony', 'Robert', 'markwinn500@gmail.com', 'He/Him', '1935-03-24', 'diagnosed of COPD and low blood pressure, Anxiety, Depression, Frailty, artrial Fibrilation. does not go outside due to risk of fall.', '752 529 3344', '', 'None', 'Male', 'Kinver', '8', 'Pinewood Cl, Wolverhampton, Staffordshire', 'Wolverhampton', 'West Midlands', 'WV5 0HA', 'United Kingdom', 'Keysafe 3859\r\nuse the top key hole on the door.', 'Robert lives alone in his house. Independently mobile with a frame or stick. communicate verbally, likes to maintain his independent, struggles to complete some tasks due to shortness of breath.\r\nLives downstairs in property. has normal diet, likes porrige for breakfast, and some fruits. drinks tea with NO Sugar.\r\nDNAR: YES\r\ndagnosed of COPD and low blood pressure, Anxiety, Depression, Frailty, artrial Fibrilation.\r\ndoes not go outside due to risk of fall.\r\nadministers medication by self. carer to support with personal care, wash or shower as required, meal preparation, emptying of urine bottle which is always be his bed side. tidy up of work surface.\r\nI sit on a pressure cushion and have got and air inflated toper on my bed.', 'Wolverhampton', 'Active', '#27ae60', '2024-09-13T12:30', '', '1027', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.5764087', '-2.1885531', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(123, 'Miss.', 'Zara', 'Adam', 'Amani', 'Zara', 'zaraadam_@outlook.com', 'She/Her', '2002-10-02', '-', '771 925 1146', '', 'None', 'Female', 'ST', 'Flat J', 'Horwood , Keele, Newcastle, Staffordshire', 'Stoke on Trent', 'West Midlands', 'ST5 5BG', 'United Kingdom', '-', '** KINDLY NOTE:\r\n1. 1, Horwood J Flat\r\nHorwood Halls of Residence\r\nUni.of Keele\r\nST5 5BG\r\nFlat J- GREEN DOOR\r\nName: Zara\r\nNumber:+447719251146\r\n\r\n2. Kindly ask questions before doing any task.\r\n3. ', 'Stoke on Trent', 'Left Service', 'rgba(142, 68, 173,1.0)', '2024-09-18T12:30', '', '1028', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '53.0002103', '-2.2677246', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-11-05 10:32:36'),
(124, 'Mrs.', 'Susan', 'Jones', '', 'Susan', '', 'She/Her', '1947-08-07', 'Hypertensive/Hallucination/Prone to falls.', '178 262 5386', '', 'None', 'Female', 'ST', '9', 'Cotswold Ave, Newcastle, Staffordshire, ', 'Stoke on Trent', 'West Midlands', 'ST5 6HP', 'United Kingdom', '1947', '1. She is Hypertensive/Hallucination/Prone to falls.\r\n***Medication must be timely.\r\n***GP: Dr.Murphy-03003650002\r\n2. Rose (Friend) 07761980682', 'Stoke on Trent', 'Active', '#27ae60', '2024-09-24T10:00', '', '1029', 'Domiciliary care', 'Null', 'Null', 'Null', 'Charles Bonnet syndrome, Cataracts, Hypertension', 'Null', 'Null', 'Null', 'Null', '', '', '53.0212814', '-2.2483693', '', '100521953', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(125, 'Mr.', 'Terence ', 'Jones', 'Brian', 'Brian ', '', 'He/Him', '1941-02-05', '-', '178 278 6047', '7519023851', 'None', 'Male', 'ST', '44', 'Mitchell Ave, Talke', 'Stoke on Trent', 'West Midlands', 'ST7 1JR', 'United Kingdom', '1942', '-', 'Stoke on Trent', 'Active', '#27ae60', '2024-09-25T10:30', '', '1030', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '53.0817384', '-2.2553529', '', '100426470', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(126, 'Mr.', 'Benjamin ', 'Shuttleworth', '', 'Ben', '', 'He/Him', '1982-03-12', '-', '745 928 8296', '', 'None', 'Male', 'Cannock', '17', 'Yew Tree Cl, Cannock, Staffordshire ', 'Wolverhampton', 'West Midlands', 'WS11 9UA', 'United Kingdom', '-', '-', 'Wolverhampton', 'Active', '#27ae60', '2024-09-20T12:00', '', '1031', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6726603', '-1.9714428', '', '7221524', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(127, 'Ms.', 'Joyce', 'Williams', '', 'Joy', 'carlajwilliams@hotmail.com', 'She/Her', '1954-01-19', 'struggle with breathing and have an oxygen concentrator', '154 387 9716', '7531927700', 'None', 'Female', 'Cannock', '20', 'Kingsley Ave, Cannock, Staffordshire ', 'Wolverhampton', 'West Midlands', 'WS12 4EA', 'United Kingdom', 'KEY SAFE: 2411', 'I am Joyce Williams, I preferred to be called Joy. I live alone in my Bungalow. Kindly ring the bell and get the key in the key safe: CODE 2411. I use to work in the healthcare sector and later supported my husband as his full time carer before he went to the care home. I have three children and they visit to support me with domestic tasks.\r\nI am independent. However, I struggle with breathing and I have an oxygen concentrator in the living room that support me with breathing. I sit in the living watching TV most of the time. I want carer to support me with meal preparation in the morning - I prefer to have CRUNCHY NUT and COLD MILK for breakfast every morning. I also need carers to warm and keep chicken soup in the flask as lunch. I always keep bottles of water by myside for hydration. The foods are in the kitchen cabinet. Carers should prompt me to administer my medication in the morning before they leave.', 'Wolverhampton', 'Permanent', 'rgba(52, 31, 151,1.0)', '2024-09-20T12:30', '', '1032', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.7158642', '-1.9979166', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-30 11:48:30'),
(128, 'Ms.', 'Jean ', 'Wildman', '', 'Jean', 'markfoodoflove@gmail.com', 'She/Her', '1955-09-20', '-', '742 110 6673', '', 'Christianity', 'Female', 'Cannock', '227', 'Cannock Rd, Wolverhampton, Staffordshire', 'Wolverhampton', 'West Midlands', 'WV10 8QL', 'United Kingdom', 'No key safe, knock at the door for family to let you in.\r\nHouse is at the opposite side of the road after the Westcroft Nursery.', 'JW lives with Her husband and son in a big house, JW and husband lives downstairs while son uses the top floor. JW requires support of one carer with personal care: strip wash in the downstairs washroom. JW has a brace attached to right leg due to shatted knee cap after a fall in July, family supports with removing of brace when required, carer to be mindful o prventing water from getting to leg brace. JW is slowly independently mobile with zimmer frame and Risk of Fall. Commode to be used to transfer when JW is not able to mobilise long distance. one Carer to support when mobilising to wash room and back to chair with a side supportive escort to supervise and encourage. JW sits on a pressure cushion on her resting chair in the lounge. One carer to support with wash, dress and undress, mobility with frame, breakfast when required as family often does the meals, JW administers her pain killer medications herself, carer to support with creams.', 'Wolverhampton', 'Active', '#27ae60', '2024-09-20T12:30', '', '1033', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.5960209', '-2.1161566', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(129, 'Mr.', 'John', 'Arrowsmith', '', 'John', '', 'He/Him', '1942-04-03', 'John is currently not able to stand or walk due to weakness in legs from knee to feet.', '190 284 3570', '7977737913', 'None', 'Male', 'Codsall', '43', 'Ravenhill Dr, Wolverhampton, Staffordshire', 'Wolverhampton', 'West Midlands', 'WV8 1BL', 'United Kingdom', 'No key safe. Knock at the door for Pat to let you in', 'John is an elderly man who lives alone in his home but neighbour, Pat is often with him to support him all the time. communicates verbally, full mental capacity, wears dentures.\r\nDNAR: NO\r\nJohn is diagnosed with Diabetes and does not have sugar, Insulin injection is administered daily by the nurses. John is currently not able to stand or walk due to weakness in legs from knee to feet.\r\nTransfer is with the molift with belt, John is able to hold onto the molift to transfer to wheeled commode when he needs the toilet. The commode is a means of transfer to bed and back to chair.\r\nJohn will have a wash every morning while sat in bed or on the commode. Support with change of clothes, creams application of legs due to dried skin. Support with making breakfast of choice with a glass of water and cup of coffee with NO SUGAR.\r\nJohn awaits review of the physio. \r\nEncourage John to practice is prescribed exercise when ever he stands on the molift; John to lift left foot up and down, lift right foot up and down, repeat this exercise a few times before sat back on chair at all calls.\r\nJohn is catheterised; Support with catheter care such as emptying bag at all calls. change catheter weekly as scheduled, connect night bag at bed time and ensure catheter is flowing into night bag, detach night bag every morning and lock catheter valve. empty and wash commode at all calls as Pat also supports to use the commode during the day.\r\nJohn has his medications in Dose box which he administers by self. Inform Pat and John before leaving at all calls.\r\nEnsure John has his trolley at his bed side at bed time with all required item on it; water etc.', 'Wolverhampton', 'Active', '#27ae60', '2024-09-23T14:30', '', '1034', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6286671', '-2.1936668', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-09-30 09:20:09'),
(130, 'Mr.', 'John', 'Twigg', '', 'John', 'jontdebs@gmail.com', 'He/Him', '1951-05-17', '-', '178 271 4581', '754 817 6668', 'None', 'Male', 'ST', 'Northwood Ln', 'Newcastle, Staffordshire ', 'Stoke on Trent', 'West Midlands', 'ST5 4BN', 'United Kingdom', '-', '-', 'Stoke on Trent', 'Other', 'rgba(211, 84, 0,1.0)', '2024-09-24T09:00', '', '1035', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.9788197', '-2.2163232', '', '9820075', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-11-20 09:51:49'),
(131, 'Mr.', 'Trevor', 'Jinks', '', 'Trevor', '', 'He/Him', '1942-04-20', '-', '178 256 1188', '', 'None', 'Male', 'ST', '7', 'Ripon Ave, Newcastle ,', 'Stoke on Trent', 'West Midlands', 'ST5 7DZ', 'United Kingdom', 'Knock and wait for his wife to open door', 'NOTES:\r\n1. Knock and wait for his wife to open door.\r\n2. Introduce yourself and show your ID card.\r\n3. Encourage out of bed-he may get full strip wash either in the living room or bedroom. Allow independence where required.\r\n4. Ask for his choice of cloth ensuring it is weather friendly.\r\n5. HIS FEET IS BANDAGED, WATER MUST NOT TOUCH THE BANDAGE.\r\n6. Transfer with his wheeled commode when required.\r\n7. He gets transferred with his wheeled commode.\r\n8. He has pressure reliving cushion, bed  overlay mattress.', 'Stoke on Trent', 'Left Service', 'rgba(142, 68, 173,1.0)', '2024-09-23T10:30', '', '1036', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '53.0417566', '-2.2496026', '', '100527109', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-18 09:56:41'),
(132, 'Mr.', 'John', 'Tomkinson', '', 'John', '', 'He/Him', '1955-02-18', '-', '784 169 0662', '', 'None', 'Male', 'Burntwood', '26', 'Biddulph Park,, Ironstone Road, Burntwood, Staffordshire', 'Wolverhampton', 'West Midlands', 'WS7 1LG', 'United Kingdom', '-', 'Turn right to Biddulph Park along Ironstone road and follow the road to the end. Take to the right further, the property is the third grey building by the left after a yellow bungalow. The entrance is via the  left side of the bungalow. ', 'Wolverhampton', 'Other', 'rgba(211, 84, 0,1.0)', '2024-09-25T16:00', '', '1037', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.688553', '-1.9460697', '', '9815568', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-16 11:43:46'),
(133, 'Mrs.', 'Ann', 'Bowers', '', 'Ann', '', 'She/Her', '1934-07-11', '-', '178 276 7281', '', 'None', 'Female', 'ST', '24', 'Thames Dr, Biddulph, Stoke-on-Trent ', 'Stoke on Trent', 'West Midlands', 'ST8 7HL', 'United Kingdom', '-', 'NOTES:\r\n1. AB lives with her son Peter(07375051447)\r\n2. She would tell you how she wants it to go.\r\n3. Full body wash, son would leave out clean clothes.\r\n4. Support with meals and medication where son is unable to do so. (ask if she would like anything or if she has had something to eat and medication)\r\n5. Open and close curtains at right time\r\n6. Remove shoes or wear shoe protector.\r\n7. Report concerns as soon as possible to office and son.\r\n8. In emergency case kindly call: 999/111/on call/son\r\n9. Ensure to do all that is required.\r\n10. AM call is 45mns. kindly exhaust the time.\r\n11. If running late, you know way before time kindly call and inform.', 'Stoke on Trent', 'Other', 'rgba(211, 84, 0,1.0)', '2024-10-02T07:00', '', '1038', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '53.1172465', '-2.1660684', '', '100504724', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-25 11:37:49'),
(134, 'Mr.', 'Robert', 'Nixon', '', 'Robert', '', 'He/Him', '1938-03-01', '-', '178 252 2676', '', 'None', 'Male', 'ST', '20', 'Slater St, Biddulph, Stoke-on-Trent ', 'Stoke on Trent', 'West Midlands', 'ST8 6JF', 'United Kingdom', 'Key Safe: 2409\r\n\r\nLock Box (Medication): 409', 'NOTES\r\n1. Its medication only 15mns.\r\n\r\n2. All medications are in original packs carefully read  through they are not much.\r\n\r\n3.Kindly take not the CREON 2500 Gastro Resistant capsules, is 3 tablets, at Tea time with or after main meal (ensure he has had something to eat please)\r\n\r\n4.Keith is his brother in law (call for anything +44781 5538021)', 'Stoke on Trent', 'Deceased', 'rgba(231, 76, 60,1.0)', '2024-10-03T12:30', '', '1039', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '53.0400718', '-2.2042029', '', '100463085', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-24 08:45:34'),
(135, 'Mr.', 'George', 'Beasley', '', 'George', '', 'He/Him', '1931-10-05', '-', '178 251 1426', '783 460 7716', 'None', 'Male', 'ST', '27', 'Newpool Terrace, Brown Lees', 'Stoke on Trent', 'West Midlands', 'ST8 6PE', 'United Kingdom', '1939', 'NOTES:\r\n1. Use key safe\r\n2. Introduce yourself on arrival.\r\n3. Prompt to go to the bathroom for wash or shower (if shower ensure shower seat is in place)\r\n4. Christine (daughter) 07834607716\r\n5. Call emergency; 999/111/on call line and family.\r\n6. Report medication running out 3-5 days before the last one.\r\n7. Ensure he has taken something before administering his medications****\r\n8. AM call is 45mns kindly note.\r\n9. Ensure you have tidied up all used areas.\r\n10. Open/close curtains\r\n11.Communicate with him, he can make choices\r\n\r\n*** cameras are installed to monitor him and care calls by daughter. Family are fully involved in his care.', 'Stoke on Trent', 'Active', 'rgba(39, 174, 96,1.0)', '2024-10-08T11:30', '', '1040', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '53.103604', '-2.1855398', '', '100473014', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-11-20 09:50:17'),
