(137, 'Mr.', 'Gary', 'Jeffcott', '', 'Gary', '', 'He/Him', '1935-11-13', 'Poor mobility', '178 251 1560', '', 'None', 'Male', 'ST', '-', 'Newtown, Stoke-on-Trent', 'Stoke on Trent', 'West Midlands', 'ST8 7SW', 'United Kingdom', '1935', '***ADDRESS: \r\n                         Newton Road\r\n                         Biddulph\r\n                         ST8 7SW \r\n1. Kindly, ask him if he wants the Laxido and Lactulose before administering.\r\n2. Drinking water is to be taken from the bathroom tap(cold one). DO NOT GIVE DRINKING WATER TAKEN FROM THE KITCHEN PLEASE, FAMILY SAYS IT IS NOT CLEAN WATER.\r\n3.He mobilises using his walking sticks (he has 2)He mobilises slowly so be patient with him.\r\n4. He likes to take his shower in the afternoon and he does this himself-but you do assist him where he requires it.\r\n5.He puts on his previous clothes and changes them when he has his showers.\r\n6.GJ MEALS:\r\nAM-2 Weetabix, 1mug of tea no sugar with milk.\r\n        Roomas of toast thick with butter.\r\nLUNCH- 2 thick sandwich and 11 mug of tea.\r\nTEA- Hot meal-cottage pie or vegi and meat.\r\nBED-1 weetabix, milk no sugar and 1 mug of tea,', 'Stoke on Trent', 'Active', '#27ae60', '2024-10-19T12:00', '', '1042', 'Domiciliary care', 'Null', 'Null', 'Null', 'Hearing disability', 'Null', 'Null', 'Null', 'Null', '', '', '53.0883655', '-2.2035977', '', '1216984', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-21 09:53:41'),
(138, 'Mrs.', 'Joyce', 'Colley', '', 'Joyce', '', 'She/Her', '1942-10-16', '-', '790 637 5306', '793 871 9525', 'None', 'Female', 'ST', '37', 'Harper Ave, Newcastle-under-Lyme, Newcastle ', 'Stoke on Trent', 'West Midlands', 'ST5 9DT', 'United Kingdom', '1942', '##JC has short term memory (awaiting memory clinic apt.)\r\n-Mini stroke (Sept. 2024)\r\n-Rectal Hemorrhage (Feb.2024)\r\nBi Lateral leg swelling (Nov. 2023)\r\n-Dyspnea (Oct. 2023)\r\n* EMERGENCY: 999/111/\r\n* Sister: Bertram-01782619111\r\n*Son:Steven-07906375306\r\n*Son:Adrian-07585009843\r\n*Medication time conscious\r\n*', 'Stoke on Trent', 'Active', '#27ae60', '2024-10-25T13:00', '', '1043', 'Domiciliary care', 'Null', 'Null', 'Null', 'Short term memory loss, Rectal hematoma, Dyspnea', 'Null', 'Null', 'Null', 'Null', '', '', '53.0263818', '-2.2311888', '', '100526575', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-30 11:19:16'),
(139, 'Mr.', 'Ian', 'Betts', '', 'Ian', '', 'He/Him', '1943-11-19', '-', '785 196 9836', '154 327 8492', 'None', 'Male', 'Cannock', '71', 'Norton E Rd, Cannock, Staffordshire, ,', 'Wolverhampton', 'West Midlands', 'WS11 9RR', 'United Kingdom', 'Key safe: 1947 ( the big key safe)', 'Ian lives with wife in a house, communicates verbally and independently mobile with frame or stick. Carer to support during transfer to ensure safety.  Promote independence by providing required items to complete personal care, support to wash hard to reach areas of body. \r\nSupport is required to get out of bed in the morning, support with a wash upstairs, clothes change and support to come downstairs using the stairs lift. support with preparing breakfast (3 wheatabix), make and leave sandwich for his lunch, support with medication administration. record and report any concern to the office. supports to bed at bed call, change of clothes and ensure comfortable. ensure door is locked and key returned to safe before leaving.', 'Wolverhampton', 'Active', '#27ae60', '2024-10-22T15:00', '', '1044', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.673161', '-1.9641061', '', '100521028', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-25 14:01:57'),
(140, 'Ms.', 'Marjorie', 'Whitehouse', '', 'Marjorie', '', 'She/Her', '1936-09-17', '-', '154 332 6624', '', 'None', 'Female', 'Burntwood', '59', 'Morley Rd, Burntwood, Staffordshire, ', 'Wolverhampton', 'West Midlands', 'WS7 2DE', 'United Kingdom', 'Keysafe 1736.\r\nLocation: right outside corner of the porch. porch door is not locked, key is for entrance door.\r\nHouse is located on opposite side of the road after the Co-OP\r\n', 'Marjorie lives with Son, Stephen and a gentle black cat in a house with a drive way long the road. slowly independently mobile with frame. urine and bowel continent but a few times may have bowel incontinent at night. MW has he left leg shorter than the right so wears a special boot to help even this up, boot to be worn every morning after washing legs, applying cream to leg (from knee to feet), put on compression socks, leg brace and black boot.\r\nDNAR: NO\r\nMW communicate verbally, has full mental capacity, MW assess bedroom upstairs with the stairs lift. carer to promote independence by passing her warm water bowl with flannel and soap to support self with wash and support to wash hard to reach areas like back. Likes to have her body wash and leg wash while sat on the commode in bedroom. MW wears dentures; denture to be put in steradent liquid at bed call and wash to put on at morning call.\r\nAM: support out of bed to sit on commode for strip wash, leg wash, put on socks, brace and boot, clothes change, denture replaced and support down stairs for breakfast, wash commode, ensure safe in sitting position and lock door, keep keys in safe.\r\nPM: support to go upstairs to bedroom with the stairs lift, change of clothes, keep denture in steradent liquid, make comfortable in bed. ensure door is secured.', 'Wolverhampton', 'Active', '#27ae60', '2024-10-21T13:00', '', '1045', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6826608', '-1.9197391', '', '8054157', 'd8fc9011255b509d7ad3fe3d960a8