(141, 'Mr.', 'Kenneth', 'Keeling', '', 'Kenneth', '', 'He/Him', '1936-02-05', 'Dementia', '786 630 9459', '', 'Christianity', 'Male', 'Codsall', '36', 'Fairfield Dr, Wolverhampton, Staffordshire', 'Wolverhampton', 'West Midlands', 'WV8 2AE', 'United Kingdom', 'no key safe, wife will open door for carers. ', 'I worked as a bank manager at NatWest bank. \r\nKenneth has Dementia and he lives with his wife and his daughter and sons visits often. Assist to put compression sock/stocking on after wash. Kenneth prefers to have a wash in his room using a wash bowl. Kenneth enjoy have a chat and is quite laid back. ', 'Wolverhampton', 'Active', '#27ae60', '2024-10-22T16:00', '', '1046', 'Domiciliary care', 'My wife, daughter and my two sons are important to me.   My home is important to me. My parents use to own a pub where I use to work as a youth until I join the bank working a a bank manager. ', 'I use to enjoy sudoku, gardening, going on holiday travelling to different countries, and watching the tv. \r\n\r\nI do not like being told what to do sometimes. ', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.6288881', '-2.2069164', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-30 14:34:09'),
(142, 'Mrs.', 'Joan', 'Beare', 'Lilian ', 'Joan', '', 'She/Her', '1942-10-22', 'Dementia and Parkinson', '777 469 3054', '', 'None', 'Female', 'Wombourne', '7', 'Millfields Way, Wombourne, Wolverhampton, Staffordshire ', 'Wolverhampton', 'West Midlands', 'WV5 8HA', 'United Kingdom', 'Carers should kindly park their cars in front of the white store door, walk in through the back door beside the store.', 'I am Joan Lilian Beare, preferred to be called Joan. I use to work in a printing company and I later retired to support the family. I am currently diagnosed with Dementia and Parkinson. I could not do much by myself after I had a hip replacement surgery few weeks ago.  Thus, I need carers to assist me with body wash in the bathroom. I will like to change my clothes everyday. My husband support me with drink, meal and medication.', 'Wolverhampton', 'Active', '#27ae60', '2024-10-23T15:00', '', '1047', 'Domiciliary care', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', 'Null', '', '', '52.5297569', '-2.2110831', '', '', 'd8fc9011255b509d7ad3fe3d960a8933af1d678d51510cd39fcf749f53dcfd74', '2024-10-31 15:02:45'),
